import React from 'react';
import { Link as L } from 'react-router-dom';
import Logout from '../user/Logout';
import useDeleteToken from '../auth/useDeleteToken';

const Header = (props) => {
    const {endToken, setEndToken} = useDeleteToken();
    console.log('header', endToken);
    if(endToken){
      return(
        <>
                <L className="navbar-brand" to="/signup">
                    Sign Up
                </L>
                <L className="navbar-brand" to="/login">
                    Log in
                </L>
                </>
      )
    }

    // const handleLogout = (endToken) => setEndToken(endToken);
    return(
        <nav className="navbar navbar-dark bg-primary fixed-top">
            <L className="navbar-brand" to="/">
                Q&Aqq
            </L>
            <div>
              {props.token ? 
              (
                <Logout token={props.token} />
              )
               : 
              (<>
                <L className="navbar-brand" to="/signup">
                    Sign Up
                </L>
                <L className="navbar-brand" to="/login">
                    Log in
                </L>
                </>
              )
              }
            </div>
        </nav>
    )
}

export default Header;
